import React from 'react';
import "./styles/menu.css";
import "../../src/global.css";
import data from "../../src/data.json";

class Menu extends React.Component{
    render(){
        console.log(data)
        data.menuInfo.map(itemMenu=>(
            <li key={itemMenu.id}><a href="default.asp">{itemMenu.name}</a></li> 
        ))
        return <nav>
            <ul>

                <li><a href="news.asp">Satena</a></li>
                <li><a href="contact.asp">Wingo</a></li>
                <li><a href="about.asp">EasyFly</a></li>
                <li><a href="about.asp">LATAM </a></li>
                <li><a href="about.asp">Delta</a></li>
            </ul>
        </nav>
    }
}

export default Menu;
